import axios from 'axios'

interface IResponse {
  cities: Array<[string, number, number]>
}

export const fetchCities = async (search: string): Promise<IResponse | any> => {
  const response = await axios.get(`http://localhost:8000/api/v1/cities/?q=${search}`)
  const cities = response.data

  return cities
}
